TriggerLogic.CodeStr:
-- spawn Brawlers and Rapiers
local shiftTable = {"shift"}
local deployRange = 300 local spawnPoints = { {-1000, 13288}, {13288, -1000}, {13288, -1000}, {13288, 6144}, {-1000, 13288}, } local targetPoints = { {1100, 9000}, {7000, 800}, {11200, 2700}, {7100, 6000}, {5400, 10500}, } local facings = {1, 3, 0, 3, 3} local height = 400
for group=1,5 do local cx, cz = unpack(spawnPoints[group]) local tx, tz = unpack(targetPoints[group])
for i=1,3 do local offsetX = math.random(-deployRange, deployRange) local offsetZ = math.random(-deployRange, deployRange) local px, pz = cx + offsetX, cz + offsetZ local unitID = Spring.CreateUnit("armbrawl", px, height, pz, facings[group], 7) Spring.SetUnitPosition(unitID, px, height, pz) Spring.GiveOrderToUnit(unitID, CMD.FIGHT, {tx + offsetX, height, tz + offsetZ}, shiftTable) Spring.GiveOrderToUnit(unitID, CMD.FIGHT, {2400 + offsetX, height, 1800 + offsetZ}, shiftTable) end for i=1,8 do local offsetX = math.random(-deployRange, deployRange) local offsetZ = math.random(-deployRange, deployRange) local px, pz = cx + offsetX, cz + offsetZ local unitID = Spring.CreateUnit("gunshipsupport", px, height, pz, facings[group], 7) Spring.SetUnitPosition(unitID, px, height, pz) Spring.GiveOrderToUnit(unitID, CMD.FIGHT, {tx + offsetX, height, tz + offsetZ}, shiftTable) Spring.GiveOrderToUnit(unitID, CMD.FIGHT, {2400 + offsetX, height, 1800 + offsetZ}, shiftTable) end end

